import React from 'react'
import "./LikedBy.css"
import Friend from "./Friend"
import { useState, useEffect } from 'react'
import axios from 'axios'
import { useLocation } from 'react-router'

//612772bcd7941bae1cd87855

const LikedBy = () => {

    const location = useLocation()
    const path = location.pathname
    const [likedBy, setlikedBy] = useState([])

    const currId = "612772bcd7941bae1cd87855"

    useEffect(() => {
        const fetchLikedBy = async () => {
            try {
                const likes = await axios.get(`post/${currId}`)
                setlikedBy(likes.data.likedBy)
            } catch (err) {
                console.log(err)
            }
        }
        fetchLikedBy()
    }, [])

    return (
        <>
            <div className='Container'>
                <div className="title_user">Liked <span className="title_user">By</span></div>
                <div className='Users'>
                    {likedBy.map((f) => (
                        <Friend friend={f} />
                    ))}
                </div>
            </div>
        </>
    )
}

export default LikedBy
